/* eslint-disable no-trailing-spaces */
/* eslint-disable no-unused-vars */
import React from 'react'
import { motion } from 'framer-motion'

function Landing () {
  const variants = {
    visibleX: {
      x: 0,
      transition: {
        when: 'beforeChildren',
        // staggerChildren: 3,
        type: 'spring',
        damping: 15
      }
    },

    visibleY: {
      y: 0,
      transition: {
        delay: 0.7,
        type: 'spring',
        damping: 15
      }
    }
  }
  return (
    <motion.div className='landingContainer'
      initial={{ x: -10000 }}
      variants={variants}
      animate='visibleX'
    >
      <motion.div className='landingTop'
      >
      </motion.div>

      <motion.div className='landingBottom'
      >
      </motion.div>

      <motion.div className='contentContainer'
        initial={{ y: -1000 }}
        variants={variants}
        animate='visibleY'
      >
        <div className='landingTitle'>Repertoire</div>
        <div className='landingAnimation'>
          <img src={require('../assets/old-man-listening-songs-on-a-phone.png')} className='animation'></img>
        </div>
        <div className='landingAlbums'>
          <div className='landingAlbum1'>
            <img src={require('../assets/caprisongs.jpeg')} className='albumImg'></img>
          </div>
          <div className='landingAlbum2'></div>
          <div className='landingAlbum3'></div>
          <div className='landingAlbum4'></div>
        </div>
        <motion.button className='signIn'
          whileTap={{ scale: 0.9 }}
        >
          <p>Sign In</p>
        </motion.button>
      </motion.div>
    </motion.div>
  )
}

export default Landing
